import React from 'react';
import "./Header.css"

const Header = () => {
  return (
    <div className='row'>
        <div className='col-md-2'>
            <img src="../../images/top-left.PNG" className='img-fluid' alt='header-left' />
        </div>
        <div className='col-md-8'></div>
        <div className='col-md-2'></div>
    </div>
  )
}

export default Header;
